/* NAND Flash patch command*/
#define CMD_NFLASHERASEBLOCK  4294967216UL /**< 0xFFFFFFB0UL */
#define CMD_NFLASHISBLOCKBAD  4294967217UL /**< 0xFFFFFFB1UL */
#define CMD_NFLASHPARAMETERS  4294967218UL /**< 0xFFFFFFB2UL */
#define CMD_NFLASHSTATUS      4294967219UL /**< 0xFFFFFFB3UL */
#define CMD_NFLASHMAP         4294967220UL /**< 0xFFFFFFB4UL */
#define CMD_NFLASHSETBLOCKBAD 4294967221UL /**< 0xFFFFFFB5UL */

/**
 * @brief Send CMD_NFLASHERASEBLOCK
 *
 * @param phost Pointer to Hal context
 * @param block Block number to erase
 */
void EVE_CMD_NFLASHERASEBLOCK(EVE_HalContext *phost, uint32_t block)
{
    EVE_Cmd_startFunc(phost);
    EVE_Cmd_wr32(phost, CMD_NFLASHERASEBLOCK);
    EVE_Cmd_wr32(phost, block);
    EVE_Cmd_endFunc(phost);
}

/**
 * @brief Send CMD_NFLASHISBLOCKBAD
 *
 * @param phost Pointer to Hal context
 * @param block Block number to test
 * @param status Status of block
 * @return uint32_t Block status
 */
uint32_t EVE_CMD_NFLASHISBLOCKBAD(EVE_HalContext *phost, uint32_t block, uint32_t status)
{
    uint32_t wp;

    EVE_Cmd_startFunc(phost);
    EVE_Cmd_wr32(phost, CMD_NFLASHISBLOCKBAD);
    EVE_Cmd_wr32(phost, block);
    EVE_Cmd_wr32(phost, status);
    EVE_Cmd_endFunc(phost);

    /* Wait for the result */
    if (!EVE_Cmd_waitFlush(phost))
        return 0;
    wp = EVE_Hal_rd32(phost, REG_CMD_WRITE) & EVE_CMD_FIFO_MASK;
    return EVE_Hal_rd32(phost, RAM_CMD + ((CMDBUF_SIZE - 4) & (wp - 4)));
}

